webpackJsonp([0x7212e273dcd4],{7914:function(e,t){e.exports={data:{post:{html:"<p>Yesterday I thought it was funny that we'd have only one car for 24 hours (Frauke will borrow her mother's car until her Touran arrives). Not anymore. This morning as Frauke wanted to drive to the bakery, the Lupo refused to start. The engine catches, but when we release the key it cuts out after 1 or 2 seconds. </p>\n<p>We're now waiting for the tow truck from our VW garage to arrive and to arrange a loaner car. This certainly puts a kink in our plans for today. :-(</p>\n<p>Update: Just as I was to post this entry, the tow truck arrived with the loaner car on board. Our business has been saved!</p>",fields:{title:"14 Hours",date:"30 Jun 2007",url:"https://papascott.de/2007-06-30-14-hours/"}}},pathContext:{slug:"/2007-06-30-14-hours/",prev:{fields:{title:"Before...",date:"29 Jun 2007",slug:"/2007-06-29-before/"}},next:{fields:{title:'First Day of "Work"',date:"01 Jul 2007",slug:"/2007-07-01-first-day-of-work/"}}}}}});
